var script$5 = {
  name: "AnkaHeader",
  components: {
    NavButton,
    CommonButton,
    ExpandMenu,
    SecondHeader
  },
  props: {
    isLogin: {
      default: false,
      type: Boolean
    }
  },

  data() {
    return {
      openDialog: false,
      activeLabel: "",
      menuIconLight: true
    };
  },

  computed: {
    loginButtons() {
      if (this.isLogin) {
        return [{
          label: "进入平台",
          plain: true,
          click: () => {
            this.redirect("/quant/");
          }
        }];
      }

      return [{
        label: "登录",
        plain: true,
        click: () => {
          this.redirect({
            event: "login"
          });
        }
      }, {
        label: "注册",
        click: () => {
          this.redirect({
            event: "register"
          });
        }
      }];
    },

    buttons() {
      let config = anka.header.default;

      if (/(\/about|\/recruitment)/.test(this.getPath())) {
        config = anka.header.others;
      }

      return config.map(btn => {
        if (btn.more) {
          btn.active = this.activeLabel === btn.label;
        } else if (btn.link) {
          btn.active = this.getPath().includes(btn.link);
        }

        return btn;
      });
    },

    isInProduce() {
      const producePageLink = ["/rqdata", "/rqpro"];
      return !producePageLink.includes(this.getPath()) || this.activeLabel ? "header__bg" : "header__bg__produce";
    },

    isNotPageMore() {
      return this.buttons.filter(i => !i.more).filter(sub => this.getPath().includes(sub.link)).length <= 0;
    }

  },
  methods: {
    getBtnConfig(label) {
      const btns = this.buttons.filter(btn => btn.label === label);
      return btns.length > 0 ? btns[0] : null;
    },

    clickHandler(label) {
      const btn = this.getBtnConfig(label);

      if (btn) {
        if (btn.more) {
          if (this.activeLabel !== label) {
            this.activeLabel = label;
          } else {
            this.activeLabel = "";
          }
        } else if (btn.link) {
          this.$parent.handleLink(btn.link);
        }
      }
    },

    expandMenuHoverHandler(label) {
      const btn = this.getBtnConfig(label);

      if (btn && btn.more) {
        if (this.activeLabel !== label) {
          this.activeLabel = label;
        }
      }
    },

    hoverHandler(label) {
      if (this.activeLabel !== "") {
        this.expandMenuHoverHandler(label);
      }
    },

    closeChildNav() {
      this.$nextTick(() => {
        this.menuIconLight = this.isNotPageMore;
      });
      this.activeLabel = "";
    },

    getPath() {
      return this.$parent.getPath();
    },

    redirect(params) {
      this.$parent.handleLink(params);
    }

  }
};

